@alisonthewliss @Roma_Voice @Govanhill_mag @GovanhillGo @GovanhillRomaYP @QPGPC @cgcommcouncil @Belic Fun Fact for 3.14🔑 day.

According to Her Majesty's Inspectorate of Prisons' (HMIP) prisoner survey, in 2019/20 6% of men and 7% of women of the prison population in England and Wales identified as Gypsy/Irish Traveller.

They make up 0.2% of the population.🤔

Today, #Montpellier wishes the Roma, Gypsy, Sinti and Traveller communities a Happy #InternationalRomaniDay .
This is a day to remember the Romani holocaust victims and to celebrate Romani culture and raise awareness of the issues facing Romani people. 
